import React, { Component, useState } from "react";
import { render } from "react-dom";
import SlidingPane from "react-sliding-pane";
import "react-sliding-pane/dist/react-sliding-pane.css";
import { COLOR_BACKGROUND, COLOR_COLOR_TEXT1 } from '../constrant';
import "./styleschat.css"
export default function PanelInfo(props) {
    const [state, setState] = useState({
        isPaneOpen: false,
        isPaneOpenLeft: false,
    });


    return (


        <SlidingPane

            isOpen={props.isOpen}

            from='left'
            width="500px"
            hideHeader={true}
            className="containChatLeft"
            overlayClassName="containChatLeft"
            onRequestClose={() => setState({ isPaneOpenLeft: false })}
        >
            <div style={{ width: "391px", background: "transparent", marginTop: "-30px",marginLeft:"-30px" }}>
                <img 
                style={{width:"500px",height:"333px"}}
                src="data:image/jpeg;base64,"/>

                <div style={{flexDirection:'row',display:'flex',justifyContent:'space-evenly',marginTop:"35px",
                width:"500px"}}>
                    <img style={{width:"94px",height:"94px",borderRadius:"50px"}} src="https://th.bing.com/th/id/OIP.RXnQj8fTisD5HbRiQ3DaiAHaHa?w=173&h=180&c=7&o=5&pid=1.7"/>
                    <div style={{display:'flex',flexDirection:'column'}}>
                        <a style={{fontSize:"30px",color:COLOR_COLOR_TEXT1}}>Faker</a>
                        <a style={{fontSize:"30px",color:COLOR_COLOR_TEXT1}}>Professional Player</a>
                    </div>
                </div>
                <a style={{color:COLOR_COLOR_TEXT1,fontSize:'24px',textAlign:'left',background:'red', 
                marginLeft:"30px"}}>Mô tả : Lee Sang-hyeok (Korean: 이상혁; born May 7, 1996), better known by his in-game name Faker (Korean: 페이커), is a South Korean professional League of Legends player. ... Faker is renowned for his high mechanical skill and extremely versatile champion pool. He is best known for playing LeBlanc, Zed, Syndra, Azir, Ahri, and Ryze.</a>
            </div>
        </SlidingPane>

    );
};
